import styled from "styled-components";
import main from './Logos/main.png'
import cir from './Logos/cir.png'

const Toolbar = styled.header`
padding:20px;
background-color: #F56753;
font-family:Noto Serif;

color:#FFFFFF;
.grid{
    display:grid;
    grid-template-columns:10% 40% 15% 35%;
}
img{
    background-color:#F56753;
}
.img{
    margin-left:10%;
    /* padding:10px */
}
.card-text{
    //styleName: Body 1;
font-family: Noto Serif;
font-size: 1rem;
font-style: normal;
font-weight: 400;
line-height: 1.562rem;
letter-spacing: 0.01em;
text-align: left;

}
.card-title{
    font-family: Poppins;
font-style: normal;
font-weight: 500;
font-size: 1.5rem;
    color:#000000;
    margin-bottom:0px
}
.form-control {
    height:2.5rem
}

`

function Footer() {
    return (
        <>
            <Toolbar>
                <div className="fluid-container" >
                    <div className="img">
                        <img src={cir} className="p-2" alt="..." />
                        <img src={main} className="p-2" alt="..." />
                    </div>

                    <div className="grid ">
                        <div>

                        </div>
                        <div>
                            <div className="card mb-3">
                                <div class="card-body">
                                    <p class="card-text">We provide campervan rental in destinations across India through a seamless and personalized online experience.</p>
                                    <p class="card-title mt-2 mb-0">Subscribe to our newsletter</p>

                                    <p class="card-text">Subscribe to receive occasional updates on top Campervan rental deals, special offers and insightful updates!</p>
                                </div>
                                <form class="d-flex">
                                    <input class="form-control me-2" type="search" placeholder="Enter  your e-mail" aria-label="Search"/>
                                    <button class ="btn btn-outline-success " type ="submit">Subscribe</button>
                                </form>
                            </div>
                        </div>
                        <div>

                        </div>
                        <div>
                            <div className="card">
                                <div className="card-body">
                                    <h5 className="card-title">Card title</h5>
                                    <p className="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
                                    <p className="card-text"><small className="text-muted">Last updated 3 mins ago</small></p>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </Toolbar>

        </>
    )
}

export default Footer
